"use client"; // Ensure this directive is present

import { useState } from "react";
import { format, parseISO } from "date-fns";
import jsPDF from "jspdf";
import { Button } from "@/components/ui/button";
import { Input } from "@/components/ui/input";

type Feedback = {
  id: string;
  messages: string;
  reply: string;
  createdAt: string; // Ensure this field is included
};

type ReportGenerationProps = {
  feedbacks: Feedback[];
};

const ReportGeneration = ({ feedbacks }: ReportGenerationProps) => {
  const [selectedMonth, setSelectedMonth] = useState<string>(format(new Date(), 'yyyy-MM'));

  const generatePDF = () => {
    console.log("Feedback data for PDF:", feedbacks);

    const doc = new jsPDF();
    const startX = 10;
    const startY = 20;
    const rowHeight = 10;
    const columnWidths = [70, 60, 60]; // Adjusted for better visibility

    // Separate replied and non-replied feedbacks
    const repliedFeedbacks = feedbacks.filter((f) => f.reply !== "");
    const nonRepliedFeedbacks = feedbacks.filter((f) => f.reply === "");

    // Embedding the logo as base64 (for better reliability)
    const base64Logo = ""; // Replace with your base64 image string
    doc.addImage(base64Logo, "JPEG", startX, startY, 36, 30);

    // Set PDF Title (Learn Loop)
    doc.setFontSize(18);
    doc.text("LEARN LOOP FEEDBACK REPORT", startX + 40, startY + 15); // Title next to the logo

    // Add month selector
    doc.setFontSize(15);
    doc.text(`Month: ${selectedMonth}`, startX, startY + 40);

    // Add counts of replies and non-replies
    doc.setFontSize(12);
    doc.text(`Replies Count: ${repliedFeedbacks.length}`, startX, startY + 50);
    doc.text(`Non-Replies Count: ${nonRepliedFeedbacks.length}`, startX, startY + 60);

    const generateTable = (feedbackData: Feedback[], title: string, yPos: number) => {
      // Table headers
      doc.setFontSize(10);
      doc.setTextColor(255); // White text color
      doc.setFillColor(0, 0, 255); // Blue for headers
      doc.rect(startX, yPos, columnWidths.reduce((a, b) => a + b, 0), rowHeight, "F");

      // Align header text to left
      doc.text("Message", startX + 2, yPos + 7); 
      doc.text("Reply", startX + columnWidths[0] + 2, yPos + 7);
      doc.text("Created At", startX + columnWidths[0] + columnWidths[1] + 2, yPos + 7);

      yPos += rowHeight;

      let isAlternateRow = false;

      // Add table data
      feedbackData.forEach((feedback, index) => {
        // Use switch case for alternate row colors
        const colorCode = index % 2; // Alternates between 0 and 1
        switch (colorCode) {
          case 0:
            doc.setFillColor(240, 240, 240); // Ash for even rows
            break;
          case 1:
            doc.setFillColor(255, 255, 255); // White for odd rows
            break;
          default:
            doc.setFillColor(255, 255, 255); // Default color
            break;
        }
        doc.rect(startX, yPos, columnWidths.reduce((a, b) => a + b, 0), rowHeight, "F");

        doc.setTextColor(0); // Black text for rows
        // Align all text to the left within each column
        doc.text(feedback.messages, startX + 2, yPos + 7);
        doc.text(feedback.reply, startX + columnWidths[0] + 2, yPos + 7);
        doc.text(format(parseISO(feedback.createdAt), "yyyy-MM-dd HH:mm:ss"), startX + columnWidths[0] + columnWidths[1] + 2, yPos + 7);

        yPos += rowHeight;
      });

      return yPos + 10; // Return updated Y position for next section
    };

    // Generate the replied feedback table
    doc.setFontSize(14);
    doc.text("Replied Feedbacks", startX, startY + 70);
    let currentY = generateTable(repliedFeedbacks, "Replied Feedbacks", startY + 80);

    // Generate the non-replied feedback table
    doc.setFontSize(14);
    doc.text("Non-Replied Feedbacks", startX, currentY);
    generateTable(nonRepliedFeedbacks, "Non-Replied Feedbacks", currentY + 10);

    // Create a Blob and open it in a new tab
    const pdfBlob = doc.output("blob");
    const pdfUrl = URL.createObjectURL(pdfBlob);
    window.open(pdfUrl, "_blank");
  };

  return (
    <div className="mt-4 mb-6 flex gap-2">
      <Input
        type="month"
        value={selectedMonth}
        onChange={(e) => setSelectedMonth(e.target.value)}
        className="w-[200px] h-9"
      />
      <Button onClick={generatePDF} size="default">View PDF Report</Button>
    </div>
  );
};

export default ReportGeneration;